import React from 'react';
import { View, Text } from 'react-native';

const ExercisesScreen = () => {
  return (
    <View>
      <Text>Exercise 1</Text>
      <Text>Exercise 2</Text>
      <Text>Exercise 3</Text>
    </View>
  );
};

export default ExercisesScreen;
